首先，我们将介绍基本的代币转移： 所有者在链下签署批准 Spender 在链上调用 permit 和 transferFrom 我们将使用 Solmate 的 ERC-20 ，因为随附了 EIP-712 和 EIP-2612 batteries。 如果您还没有浏览完整合约，请看一眼 - 这里是 permit 实现的： /*////////////////////////////////////////////////////////////// EIP-2612 LOGIC //////////////////////////////////////////////////////////////*/ function permit( address owner, address spender, uint256 value, uint256 deadline, uint8 v, bytes32 r, bytes32 s ) public virtual { require(deadline >= block.timestamp, "PERMIT_DEADLINE_EXPIRED"); // Unchecked because the only math done is incrementing // the owner's nonce which cannot realistically overflow. unchecked { address recoveredAddress = ecrecover( keccak256( abi.encodePacked( "\x19\x01", DOMAIN_SEPARATOR(), keccak256( abi.encode( keccak256( "Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)" ), owner, spender, value, nonces[owner]++, deadline ) ) ) ), v, r, s ); require(recoveredAddress != address(0) && recoveredAddress == owner, "INVALID_SIGNER"); allowance[recoveredAddress][spender] = value; } emit Approval(owner, spender, value); } 我们还将使用自定义的SigUtils 合约来帮助创建、散列和签署链下批准。 // SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.13; contract SigUtils { bytes32 internal DOMAIN_SEPARATOR; constructor(bytes32 _DOMAIN_SEPARATOR) { DOMAIN_SEPARATOR = _DOMAIN_SEPARATOR; } // keccak256("Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)"); bytes32 public constant PERMIT_TYPEHASH = 0x6e71edae12b1b97f4d1f60370fef10105fa2faae0126114a169c64845d6126c9; struct Permit { address owner; address spender; uint256 value; uint256 nonce; uint256 deadline; } // computes the hash of a permit function getStructHash(Permit memory _permit) internal pure returns (bytes32) { return keccak256( abi.encode( PERMIT_TYPEHASH, _permit.owner, _permit.spender, _permit.value, _permit.nonce, _permit.deadline ) ); } // computes the hash of the fully encoded EIP-712 message for the domain, which can be used to recover the signer function getTypedDataHash(Permit memory _permit) public view returns (bytes32) { return keccak256( abi.encodePacked( "\x19\x01", DOMAIN_SEPARATOR, getStructHash(_permit) ) ); }
} 设置 使用令牌的 EIP-712 域分隔符部署模拟 ERC-20 令牌和“SigUtils”助手 创建私钥来模拟所有者和消费者 使用 vm.addr cheatcode 推导他们的地址 为所有者铸造一个测试代币 contract ERC20Test is Test { MockERC20 internal token; SigUtils internal sigUtils; uint256 internal ownerPrivateKey; uint256 internal spenderPrivateKey; address internal owner; address internal spender; function setUp() public { token = new MockERC20(); sigUtils = new SigUtils(token.DOMAIN_SEPARATOR()); ownerPrivateKey = 0xA11CE; spenderPrivateKey = 0xB0B; owner = vm.addr(ownerPrivateKey); spender = vm.addr(spenderPrivateKey); token.mint(owner, 1e18); } 389 / 5,000 翻译结果 翻译结果 测试：permit 为消费者创建批准 使用 sigUtils.getTypedDataHash 计算其摘要 使用带有所有者私钥的 vm.sign cheatcode 对摘要进行签名 存储签名的uint8 v, bytes32 r, bytes32 s 调用 permit 并带有已签署的许可证和签名以执行链上批准 function test_Permit() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: 0, deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); assertEq(token.allowance(owner, spender), 1e18); assertEq(token.nonces(owner), 1); } 确保因截止日期过期、签名者无效、随机数无效和签名重播而导致的调用失败 function testRevert_ExpiredPermit() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: token.nonces(owner), deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); vm.warp(1 days + 1 seconds); // fast forward one second past the deadline vm.expectRevert("PERMIT_DEADLINE_EXPIRED"); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); } function testRevert_InvalidSigner() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: token.nonces(owner), deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(spenderPrivateKey, digest); // spender signs owner's approval vm.expectRevert("INVALID_SIGNER"); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); } function testRevert_InvalidNonce() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: 1, // owner nonce stored on-chain is 0 deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); vm.expectRevert("INVALID_SIGNER"); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); } function testRevert_SignatureReplay() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: 0, deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); vm.expectRevert("INVALID_SIGNER"); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); } 测试：transferFrom 为支出者创建、签署和执行批准 使用 vm.prank cheatcode 调用 tokenTransfer 作为花费者来执行转移 function test_TransferFromLimitedPermit() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: 0, deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); vm.prank(spender); token.transferFrom(owner, spender, 1e18); assertEq(token.balanceOf(owner), 0); assertEq(token.balanceOf(spender), 1e18); assertEq(token.allowance(owner, spender), 0); } function test_TransferFromMaxPermit() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: type(uint256).max, nonce: 0, deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); vm.prank(spender); token.transferFrom(owner, spender, 1e18); assertEq(token.balanceOf(owner), 0); assertEq(token.balanceOf(spender), 1e18); assertEq(token.allowance(owner, spender), type(uint256).max); } 如果allowance无效和余额无效，call会失败 function testFail_InvalidAllowance() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 5e17, // approve only 0.5 tokens nonce: 0, deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); vm.prank(spender); token.transferFrom(owner, spender, 1e18); // attempt to transfer 1 token } function testFail_InvalidBalance() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 2e18, // approve 2 tokens nonce: 0, deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); vm.prank(spender); token.transferFrom(owner, spender, 2e18); // attempt to transfer 2 tokens (owner only owns 1) }

