pragma solidity ^0.8.13; 请记住，即使它是一个脚本，它仍然像智能合约一样工作，但从未部署过，所以就像任何其他用 Solidity 编写的智能合约一样，必须指定pragma version。 import "forge-std/Script.sol";
import "../src/NFT.sol"; 就像我们在编写测试时可能会导入 Forge Std 来获取测试实用程序一样，Forge Std 也提供了一些我们在这里导入的脚本实用程序。 下一行只是导入NFT合约。 contract MyScript is Script { 我们创建一个名为 MyScript 的合约，它从 Forge Std 继承了 Script。 function run() external { 默认情况下，脚本是通过调用名为run的函数（我们的入口点）来执行的。 uint256 deployerPrivateKey = vm.envUint("PRIVATE_KEY"); 这会从我们的 .env 文件中加载私钥。 注意： 在 .env 文件中公开私钥并将它们加载到程序中时必须小心。 这仅建议与非特权部署者一起使用或用于本地/测试设置。 对于生产设置，请查看 Foundry 支持的各种 钱包选项 。 vm.startBroadcast(deployerPrivateKey); 这是一个特殊的Cheatcode，用于记录我们的主脚本合约进行的调用和合约创建。 我们传递 deployerPrivateKey 以指示它使用该密钥来签署交易。 稍后，我们将广播这些交易以部署我们的 NFT 合约。 NFT nft = new NFT("NFT_tutorial", "TUT", "baseUri"); 在这里，我们只是创建我们的 NFT 合约。 因为我们在这行之前调用了 vm.startBroadcast()，合约创建将被 Forge 记录下来，并且如前所述，我们可以广播交易以在链上部署合约。 默认情况下，广播事务日志将存储在“广播”目录中。 您可以通过在 foundry.toml 文件中设置 broadcast 来更改日志位置。 现在您已经了解了脚本智能合约的功能，让我们运行它。 您应该已经将我们之前提到的变量添加到 .env 中，以便下一部分工作。 在项目运行的根目录： # To load the variables in the .env file
source .env # To deploy and verify our contract
