Test result: ok. 2 passed; 0 failed; finished in 1.03ms 测试通过是因为 prank Cheatcodes将我们的身份更改为下一次调用的零地址 (upOnly.increment())。 由于我们使用了 testFail 前缀，测试用例通过了，但是，使用 testFail 被认为是一种反模式(anti-pattern)，因为它没有告诉我们任何关于 为什么 upOnly.increment() 被revert的信息。 如果我们在启用跟踪的情况下再次运行测试，我们可以看到我们revert了正确的错误消息。 $ forge test -vvvv --match-test testFailIncrementAsNotOwner
