Test result: ok. 2 passed; 0 failed; finished in 1.15ms 另一个可能不那么直观的Cheatcodes是 expectEmit 函数。 在查看 expectEmit 之前，我们需要了解什么是事件Events。 事件Events是合约的可继承成员。 当您发出事件Events时，参数存储在区块链上。 indexed 属性可以添加到事件Events的最多三个参数中，以形成称为 Transfer 的数据结构。 Topics允许用户搜索区块链上的事件Events。 pragma solidity 0.8.10; import "forge-std/Test.sol"; contract EmitContractTest is Test { event Transfer(address indexed from, address indexed to, uint256 amount); function testExpectEmit() public { ExpectEmit emitter = new ExpectEmit(); // Check that topic 1, topic 2, and data are the same as the following emitted event. // Checking topic 3 here doesn't matter, because `Transfer` only has 2 indexed topics. vm.expectEmit(true, true, false, true); // The event we expect emit Transfer(address(this), address(1337), 1337); // The event we get emitter.t(); } function testExpectEmitDoNotCheckData() public { ExpectEmit emitter = new ExpectEmit(); // Check topic 1 and topic 2, but do not check data vm.expectEmit(true, true, false, false); // The event we expect emit Transfer(address(this), address(1337), 1338); // The event we get emitter.t(); }
} contract ExpectEmit { event Transfer(address indexed from, address indexed to, uint256 amount); function t() public { emit Transfer(msg.sender, address(1337), 1337); }
} 当我们调用 vm.expectEmit(true, true, false, true); 时，我们想要检查下一个事件Events的第一个和第二个 indexed 主题topic。 testExpectEmit() 中预期的 Transfer 事件Events意味着我们期望 from 是 address(this)，而 to 是 address(1337)。 这与从 emitter.t() 发出的事件Events进行比较。 换句话说，我们正在检查来自 emitter.t() 的第一个主题topic是否等于 address(this) 。 expectEmit 中的第三个参数设置为 false，因为不需要检查 Transfer 事件中的第三个主题topic，因为只有两个。 即使我们设置为true也没关系。 expectEmit 中的第 4 个参数设置为 true，这意味着我们要检查 "non-indexed topics"，也称为数据。 例如，我们希望来自 testExpectEmit 中预期事件Events的数据（即 amount）等于实际发出的事件Events中的数据。 换句话说，我们断言 emitter.t() 发出的 amount 等于 1337。 如果 expectEmit 中的第四个参数设置为 false，我们将不会检查 amount。 换句话说，testExpectEmitDoNotCheckData 是一个有效的测试用例，即使数量不同，因为我们不检查数据。 📚 参考 请参阅 Cheatcodes Reference 以获得所有可用Cheatcodes的完整概述。

