默克尔树 是区块链应用程序中经常使用的密码承诺方案。 它们的流行导致了默克尔树生成器、证明器和验证器的许多不同实现。 Merkle 根和证明通常使用 JavaScript 或 Python 等语言生成，而证明验证通常发生在 Solidity 的链上。 Murky 是在 Solidity 中 Merkle 根、证明和验证的完整实现。 它的测试套件包括针对 OpenZeppelin 的 Merkle 证明库的差异测试，以及针对参考 JavaScript 实现的根生成测试。 这些测试由 Foundry 的模糊测试和ffi功能提供支持。 针对参考 TypeScript 实现的差异模糊测试 使用 ffi 作弊代码，Murky 使用 Forge 的模糊器提供的数据针对 TypeScript 实现测试自己的 Merkle 根实现： function testMerkleRootMatchesJSImplementationFuzzed(bytes32[] memory leaves) public { vm.assume(leaves.length > 1); bytes memory packed = abi.encodePacked(leaves); string[] memory runJsInputs = new string[](8); // Build ffi command string runJsInputs[0] = 'npm'; runJsInputs[1] = '--prefix'; runJsInputs[2] = 'differential_testing/scripts/'; runJsInputs[3] = '--silent'; runJsInputs[4] = 'run'; runJsInputs[5] = 'generate-root-cli'; runJsInputs[6] = leaves.length.toString(); runJsInputs[7] = packed.toHexString(); // Run command and capture output bytes memory jsResult = vm.ffi(runJsInputs); bytes32 jsGeneratedRoot = abi.decode(jsResult, (bytes32)); // Calculate root using Murky bytes32 murkyGeneratedRoot = m.getRoot(leaves); assertEq(murkyGeneratedRoot, jsGeneratedRoot);
} 注意：请参阅 Murky Repo 中的 Strings2.sol 以了解启用 (bytes memory).toHexString() Forge 运行 npm --prefix differential_testing/scripts/ --silent run generate-root-cli {numLeaves} {hexEncodedLeaves}。 这使用参考 JavaScript 实现计算输入数据的 Merkle 根。 该脚本将根打印到标准输出，打印输出在 vm.ffi() 的返回值中被捕获为 bytes。 然后测试使用 Solidity 实现计算根。 最后，测试断言两个根完全相等。 如果它们不相等，则测试失败。 针对 OpenZeppelin 的 Merkle 证明库的差异模糊测试 您可能希望对另一个 Solidity 实现使用差异测试。 在这种情况下，不需要 ffi。 相反，参考实现直接导入到测试中。 import "openzeppelin-contracts/contracts/utils/cryptography/MerkleProof.sol";
//...
function testCompatabilityOpenZeppelinProver(bytes32[] memory _data, uint256 node) public { vm.assume(_data.length > 1); vm.assume(node < _data.length); bytes32 root = m.getRoot(_data); bytes32[] memory proof = m.getProof(_data, node); bytes32 valueToProve = _data[node]; bool murkyVerified = m.verifyProof(root, proof, valueToProve); bool ozVerified = MerkleProof.verify(proof, root, valueToProve); assertTrue(murkyVerified == ozVerified);
} 针对已知边缘情况的差异测试 差异测试并不总是模糊的——它们对于测试已知的边缘情况也很有用。 在 Murky 代码库的情况下，log2ceil 函数的初始实现不适用于某些长度接近 2 的幂（如 129）的数组。 作为安全检查，始终针对此长度的数组运行测试，并与 TypeScript 实现进行比较。 您可以在 此处 查看完整测试。 针对参考数据的标准化测试 FFI 还可用于将可重现的标准化数据注入测试环境。 在 Murky 库中，这被用作gas快照的基准（参见 forge snapshot ）。 bytes32[100] data;
uint256[8] leaves = [4, 8, 15, 16, 23, 42, 69, 88]; function setUp() public { string[] memory inputs = new string[](2); inputs[0] = "cat"; inputs[1] = "src/test/standard_data/StandardInput.txt"; bytes memory result = vm.ffi(inputs); data = abi.decode(result, (bytes32[100])); m = new Merkle();
} function testMerkleGenerateProofStandard() public view { bytes32[] memory _data = _getData(); for (uint i = 0; i < leaves.length; ++i) { m.getProof(_data, leaves[i]); }
} src/test/standard_data/StandardInput.txt 是一个包含编码的 bytes32[100] 数组的文本文件。 它是在测试之外生成的，可以在任何语言的 Web3 SDK 中使用。 它看起来像： 0xf910ccaa307836354233316666386231414464306335333243453944383735313..423532 标准化测试合约使用 ffi 读取文件。 它将数据解码为一个数组，然后在本例中为 8 个不同的叶子生成证明。 由于数据是恒定且标准的，我们可以使用此测试有意义地测量gas和性能改进。 当然，可以将数组硬编码到测试中！ 但这使得跨合约、实施等进行一致的测试变得更加困难。

