内部函数 要测试 internal 功能，请编写一个继承自被测合约 (CuT) 的线束合约。 从 CuT 继承的线束合约将 internal 功能公开为 external 功能。 每个被测试的 internal 函数都应该通过一个名称遵循 exposed_<function_name> 模式的外部函数公开。 例如： // file: src/MyContract.sol
contract MyContract { function myInternalMethod() internal returns (uint) { return 42; }
} // file: test/MyContract.t.sol
import {MyContract} from "src/MyContract.sol"; contract MyContractHarness is MyContract { // Deploy this contract then cll this method to test `myInternalMethod`. function exposed_myInternalMethod() external returns (uint) { return myInternalMethod(); }
} 私有函数 不幸的是，目前没有好的方法来对 private方法进行单元测试，因为它们不能被任何其他合约访问。 选项包括： 将 private 函数转换为 internal 。 将逻辑复制/粘贴到您的测试合约中，并编写一个在 CI 检查中运行的脚本，以确保两个功能相同。 Workaround函数 Harnesses 还可用于公开原始智能合约中不可用的功能或信息。 最直接的例子是当我们想要测试公共数组的长度时。 这些函数应遵循以下模式：workaround_<function_name>，例如 workaround_queueLength()。 另一个用例是跟踪您不会在生产中跟踪的数据，以帮助测试不变量。 例如，您可以存储所有代币持有者的列表，以简化不变的“所有余额的总和必须等于总供应量”的验证。 这些通常被称为“幽灵变量”。 您可以在 Rikard Hjort 的 工作 DeFi 开发的正式方法 演讲中了解更多相关信息。

